  // let name = localStorage.getItem('name')
  // let str = `mailto:${email}`
  // let userObject = {
  //   "name": name,
  //   "email": email,
  //   "password": password, 
  // }

  return (
    <>
      <div style={{ fontSize: "3rem", textAlign: "center", margin: "1%" }}>Dashboard</div>
      <div>
        {users.length > 0 && (
          <div>
            {users.map(user => (
              <table>
                <tr>
                <td key={user.id}>{user.name} - {user.email}</td>
                  <th>2</th>
                  <th>3</th>
                </tr>
                <tr>

                  <th>2</th>
                  <th>3</th>
                </tr>

              </table>

            ))}
          </div>
        )}
      </div>

    </>
  )

};

export default Home;
